import React from "react";
import { Link } from "react-router-dom";

const Navbar = ({ user }) => {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
      <div className="container">
        <Link className="navbar-brand" to="/">Food Donation</Link>
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav ms-auto">
            <li className="nav-item"><Link className="nav-link" to="/overview">Overview</Link></li>
            <li className="nav-item"><Link className="nav-link" to="/inventory">Inventory</Link></li>
            <li className="nav-item"><Link className="nav-link" to="/customers">Customers</Link></li>
            <li className="nav-item"><Link className="nav-link" to="/products">Products</Link></li>
          </ul>

          {/* âœ… Profile Picture When Logged In */}
          {user ? (
            <div className="dropdown">
              <button className="btn btn-dark dropdown-toggle d-flex align-items-center" type="button" data-bs-toggle="dropdown">
                <img src={user.profilePic} alt="Profile" className="rounded-circle me-2" width="30" height="30" />
              </button>
              <ul className="dropdown-menu dropdown-menu-end">
                <li><Link className="dropdown-item" to="/profile">Profile</Link></li>
                <li><button className="dropdown-item text-danger">Logout</button></li>
              </ul>
            </div>
          ) : (
            <Link to="/login" className="btn btn-light">Login</Link>
          )}
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
